export default function Header() {
  return (
    <div className="Header-Child bg-red-200">
      { 
        navigation.map((btn)=>{ 
          return(
            <Btn key={btn.name.toLowerCase()} name={btn.name} href={btn.href} img={btn.img} classes={btn.classes} current={btn.current} />
          );
        })
      }

    </div>
  );
}
